styles:
.inserted-frame {
    width: 100%;
    height: 100%;
    border: none;
    padding: 0;
    margin: 0;
    overflow: hidden;
    position: absolute;
    top: 0;
    left: 0;
}

.display-none-frame {
    display: none;
}

.display-block-frame {
    display: block;
}

.iframe-error {
    position: absolute;
    top: 0;
    left: 0;
    z-index: 1;
}

.iframe-error > h4 {
    font-size: 24px;
    line-height: 1;
    padding-left: 20px;
    padding-top: 20px;
    padding-bottom: 14px;
}

.iframe-error > button {
    margin-left: 20px;
    margin-bottom: 20px;
}

.iframe-error > h5 {
    font-size: 20px;
    line-height: 1;
    padding-left: 20px;
    padding-top: 10px;
    padding-bottom: 0px;
}

.iframe-error > pre {
    font-size: 14px;
    padding-top: 10px;
    padding-right: 40px;
    padding-bottom: 20px;
    padding-left: 40px;
    background: white;
    color: black;
    border: 0;
    white-space: pre-wrap;
}

